import InputMask from 'react-input-mask';
import {useState} from 'react';
import Button from './button/button';

export default function Confirmation() {

  const [name, setName] = useState('');
  const [emailstorage, setEmail] = useState('');
  const [passwordstorage, setPassword] = useState('');
  const [crmstorage, setCrm] = useState('');
  const [cpfstorage, setCpf] = useState('');
  const [phonestorage, setPhone] = useState('');
  const [specializationstorage, setSpecialization] = useState('');
    

    const  objt = sessionStorage.getItem('user');
    const j = JSON.parse(objt);
    
    const cpf = j.cpf;
    const crm = j.crm;
    const phone  = j.phone;
    const email  = j.email;
    const specialization  = j.specialization;
    const password  = j.password;
    
    async function submitOn(e) {
        e.preventDefault();
        const data = {
          name,
          emailstorage,
          passwordstorage ,
          cpfstorage,
          crmstorage,
          specialization,
          phonestorage,
          specializationstorage
        }
        
        console.log(data);
    
    }
    return (
    <div>
       <div><a href="/"><img src="https://i.imgur.com/tDvwyyA.png" className={'logo2'} title="source: imgur.com" /></a></div>
    <form>
      <h1 className='title'>Deseja alterar os dados?</h1>
      
      <div className = {"question"}>
      <input name="name" id="name" type="text" required
           value={name}
          onChange={e => setName(e.target.value)}
         
        />
        <label>Name:</label>
      </div>
      <br></br>
      <div className = {"question"}>
        <InputMask mask="999.999.999-99" name="cpf" type="text" id="cpf" required
        value={cpf}
         
        />
        
        <label>CPF:</label>
      </div>
      <br></br>
      <div className={"question"}>
        <InputMask mask="9999" id="crm" name="crm" type="text" required

        value={crm}
        />
       <label>CRM:</label>
      </div>
      <br></br>
      <div className={"question"}>
        <input name="specialization" id="crm" type="text" required
          value={specialization}
        />
        <label>Specialization:</label>
      </div>
      <br></br>
      <div className={"question"}>
        <InputMask mask="(99) 99999-9999" id="phone" name="phone" type="text" required
            value={phone}
        />
        <label>Phone:</label>   
      </div>
      <br></br>
        <div className={"question"}>
          <input name="email" id="email" type="text" required
         
            value={email}
           />
          <label>E-mail:</label>
        </div>
        <br></br>
        <div className={"question"}>
          <input mask="password" id="password" name="password" type="text" required
            value={password}
        />
        <label>Password:</label>
      </div>
      <br></br>
       
    <div className={'wrapper'}>
      <Button type="submit" onClick={(submitOn)}>submit</Button>
    </div>  
    </form>
            
        </div>
    )

}
